import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Userscreen from './Components/Userscreen';
import './App.css';

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <HomePage />
        </Route>
        <Route path="/about">
          <AboutPage />
        </Route>
      </Switch>
    </Router>
  );
}




export default App;
